import json
from typing import Dict

from decksite.data import competition, match
from decksite.scrapers import gatherling
from decksite.testutil import setup_test_db
from shared.database import sqlescape


def test_medal2finish() -> None:
    for m in gatherling.Medal:
        assert gatherling.medal2finish(m) > 0

def test_process() -> None:
    setup_test_db()
    name = 'Penny Dreadful Mondays 19.04'
    where = 'c.name = ' + sqlescape(name)
    cs = competition.load_competitions(where)
    assert len(cs) == 0
    data = json.loads(API_RESPONSE)
    response = gatherling.make_api_response(data)
    gatherling.process(response)
    event = response[name]
    cs = competition.load_competitions(where)
    assert len(cs) == 1
    c = cs[0]
    assert c.name == name
    # Make sure we don't re-insert the competition if we see it a second time.
    gatherling.process(response)
    cs = competition.load_competitions(where, should_load_decks=True)
    assert len(cs) == 1
    c = cs[0]
    assert len(c.decks) == len(event.decks)
    finishes: Dict[int, int] = {}
    for d in c.decks:
        finishes[d.finish] = finishes.get(d.finish, 0) + 1
    assert finishes[1] == 1
    assert finishes[2] == 1
    assert finishes[3] == 2
    assert finishes[5] == 4
    for i in range(9, len(c.decks)):
        assert finishes[i] == 1
    ms = match.load_matches('c.id = ' + str(c.id))
    print(ms)
    assert len(ms) == len(event.matches)
    for m in ms:
        assert (m.opponent is None) or (2 <= m.game_wins + m.game_losses <= 3)

def test_find_mtgo_username() -> None:
    data = json.loads(PLAYERS)
    ps = [gatherling.Player(**p) for k, p in data.items()]
    assert gatherling.find_mtgo_username('NotGood', ps) == 'NotGood'  # mtgo is set and the same
    assert gatherling.find_mtgo_username('AlvaroCarvalho', ps) == 'AlvaroCarvalho'  # mtgo is not set
    assert gatherling.find_mtgo_username('-IceBR-', ps) == '-iceb-'  # mtgo is set and different

def test_gatherling_url() -> None:
    assert gatherling.gatherling_url('/') == 'https://gatherling.com/'

def test_vivify_date() -> None:
    d = gatherling.vivify_date('2020-12-01 10:11:12')
    assert d.year == 2020
    assert d.month == 12
    assert d.day == 1
    assert d.hour == 10 + 5  # US Eastern time, which is what we're parsing, is 5 hours out from UTC.
    assert d.minute == 11
    assert d.second == 12
    try:
        gatherling.vivify_date('gibberish')
        raise AssertionError()
    except ValueError:
        assert True


